INSERT INTO `wp_icl_strings` VALUES('936', 'en', 'plugin jetpack', 'afe10fe658a615f234fbbb3a289c3986', 'A known issue.', '1');
INSERT INTO `wp_icl_strings` VALUES('937', 'en', 'plugin jetpack', 'a518f9f17a24b4d1fef5575513b8107c', 'An incompatible plugin.', '1');
INSERT INTO `wp_icl_strings` VALUES('938', 'en', 'plugin jetpack', '0889a7b27d2c129d1c32101556e443f9', 'Find out by disabling all plugins except Jetpack. If the problem persists, it\'s not a plugin issue. If the problem is solved, turn your plugins on one by one until the problem pops up again – there\'s the culprit! Let us know, and we\'ll try to help.', '1');
INSERT INTO `wp_icl_strings` VALUES('939', 'en', 'plugin jetpack', '6d6c1a361aa94e393732017b5c9b5a44', 'A theme conflict.', '1');
INSERT INTO `wp_icl_strings` VALUES('940', 'en', 'plugin jetpack', 'aff6db71334a888618a1206639acbcd1', 'If your problem isn\'t known or caused by a plugin, try activating Twenty Twelve (the default WordPress theme). If this solves the problem, something in your theme is probably broken – let the theme\'s author know.', '1');
INSERT INTO `wp_icl_strings` VALUES('941', 'en', 'plugin jetpack', '3cc2aef532f1c35ea768d592fd9e824b', 'A problem with your XMLRPC file.', '1');
INSERT INTO `wp_icl_strings` VALUES('942', 'en', 'plugin jetpack', '596371542c864bde6129ebe397b6b09c', 'If it\'s not by itself, a theme or plugin is displaying extra characters. Try steps 2 and 3.', '1');
INSERT INTO `wp_icl_strings` VALUES('943', 'en', 'plugin jetpack', 'c8af7ad8dbd0f1076b03ac629607b23d', 'If you get a 404 message, contact your web host. Their security may block XMLRPC.', '1');
INSERT INTO `wp_icl_strings` VALUES('944', 'en', 'plugin jetpack', '28a7447b2917ac74adc0ecabf450badc', 'Please describe the problem you are having.', '1');
INSERT INTO `wp_icl_strings` VALUES('945', 'en', 'plugin jetpack', '49ee3087348e8d44e1feda1917443987', 'Name', '1');
INSERT INTO `wp_icl_strings` VALUES('946', 'en', 'plugin jetpack', 'fb9464ac0f6490cf82eab910eb9a8b6b', 'Let us know your name.', '1');
INSERT INTO `wp_icl_strings` VALUES('947', 'en', 'plugin jetpack', '1e884e3078d9978e216a027ecd57fb34', 'E-mail', '1');
INSERT INTO `wp_icl_strings` VALUES('948', 'en', 'plugin jetpack', '6206a9dd5e3376226cea4bfa281f1e73', 'Use a valid email address.', '1');
INSERT INTO `wp_icl_strings` VALUES('949', 'en', 'plugin jetpack', '15719f7683f9f08640bedb86df8f5153', 'Debug Info', '1');
INSERT INTO `wp_icl_strings` VALUES('950', 'en', 'plugin jetpack', 'b46d3c8ee8032551c011745d587705cc', 'Snow', '1');
INSERT INTO `wp_icl_strings` VALUES('951', 'en', 'plugin jetpack', '6f0e37975e15647bb36eec687241ada4', 'Show falling snow on my blog until January 4<sup>th</sup>.', '1');
INSERT INTO `wp_icl_strings` VALUES('952', 'en', 'plugin jetpack', 'fa12fda844dbc895cd472343f470cc08', 'You can <a href=\"%s\">view your stats dashboard here</a>.', '1');
INSERT INTO `wp_icl_strings` VALUES('953', 'en', 'plugin jetpack', '51700ffd79460574f2e345b4e0e319ca', 'Manage your <a href=\"%s\">Publicize settings</a>.', '1');
INSERT INTO `wp_icl_strings` VALUES('954', 'en', 'plugin jetpack', '44dc48c6d19245f503d5b4df5c9d7631', 'You can view your notifications in the Toolbar and <a href=\"%s\">on WordPress.com</a>.', '1');
INSERT INTO `wp_icl_strings` VALUES('955', 'en', 'plugin jetpack', 'd52aca1fa451db14294b3aab880757e6', 'Use <code>$latex your latex code here$</code> or <code>[latex]your latex code here[/latex]</code> to include %s in your posts and comments. There are <a href=\"%s\" target=\"_blank\">all sorts of options</a> available.', '1');
INSERT INTO `wp_icl_strings` VALUES('956', 'en', 'plugin jetpack', '0f7fead7c05732d58d202d6650fe7e14', 'To configure your sharing settings, go to the Settings &rarr; <a href=\"%s\">Sharing</a> menu.', '1');
INSERT INTO `wp_icl_strings` VALUES('957', 'en', 'plugin jetpack', '2cc5f219ee0a1edd8b7f4e8364fed979', 'Full details can be found on the <a href=\"%s\">Sharing support page</a>. This video also gives a swish run-down of how to use the Sharing feature. Watch it in HD for extra snazz!', '1');
INSERT INTO `wp_icl_strings` VALUES('958', 'en', 'plugin jetpack', 'a687cf8f537b46fe7003d026c079b9ac', 'The <a href=\'%s\'>After&nbsp;the&nbsp;Deadline</a> Proofreading service improves your writing by using artificial intelligence to find your errors and offer smart suggestions.', '1');
INSERT INTO `wp_icl_strings` VALUES('959', 'en', 'plugin jetpack', '1d70c3fbf5fa1d71088a7a0a80d660ec', 'After the Deadline provides a number of <a href=\"%s\">customization options</a>, which you can edit in your profile.', '1');
INSERT INTO `wp_icl_strings` VALUES('960', 'en', 'plugin jetpack', '9bdb12c7bad51dd39152dffd407a8cb9', 'To use the widgets, go to Appearance &#8594; <a href=\"%s\">Widgets</a>. Drag them into one of your sidebars and configure away.', '1');
INSERT INTO `wp_icl_strings` VALUES('961', 'en', 'plugin jetpack', '801067b6a1042108989a0f0c0ae80aeb', 'To use the Subscriptions widget, go to Appearance &#8594; <a href=\"%s\">Widgets</a>. Drag the widget labeled &#8220;Blog Subscriptions (Jetpack)&#8221; into one of your sidebars and configure away.', '1');
INSERT INTO `wp_icl_strings` VALUES('962', 'en', 'plugin jetpack', '07c0b0466cec58ea92d5026e3a61bad4', 'You can also make changes to your Subscription settings at the bottom of the <a href=\"%s\">Discussion Settings</a> page.', '1');
INSERT INTO `wp_icl_strings` VALUES('963', 'en', 'plugin jetpack', '01841657bbe381ca94d41726b9445701', 'Jetpack tries to match your site\'s color scheme automatically, but you can make manual adjustments at the bottom of the <a href=\'%s\'>Discussion Settings</a> page.', '1');
INSERT INTO `wp_icl_strings` VALUES('964', 'en', 'plugin jetpack', '845444b6e2eb2158080464752ee68a14', 'To use the CSS editor, go to Appearance &#8594; <a href=\"%s\">Edit CSS</a>.', '1');
INSERT INTO `wp_icl_strings` VALUES('965', 'en', 'plugin jetpack', 'a9a0cb7c41c2f6c2ea9f3c1188248821', 'If you use <a href=\"%1$s\">WordPress for iOS</a> or <a href=\"%2$s\">WordPress for Android</a>, you’ll now be able to opt in to receive push notifications of new comments, which makes it easier than ever to keep up with your readers and moderate comments on the go.', '1');
INSERT INTO `wp_icl_strings` VALUES('966', 'en', 'plugin jetpack', '9730d466f387acecaa9f32396d168167', 'If you are a theme author, you can learn about adding support for Infinite Scroll at <a href=\"%1$s\">%1$s</a>.', '1');
INSERT INTO `wp_icl_strings` VALUES('967', 'en', 'plugin jetpack', '64ba9c6b35c5edebe16ffdefcd159df3', 'At this time, your theme, %s, doesn\'t support Infinite Scroll. Unlike other Jetpack modules, Infinite Scroll needs information from your theme to function properly.', '1');
INSERT INTO `wp_icl_strings` VALUES('968', 'en', 'plugin jetpack', 'f5f24b29ca3224be62d382d8eb090f39', 'There is an update available for your theme. You may wish to check if this update adds Infinite Scroll support by visiting the <a href=\"%s\">WordPress Updates</a> page.', '1');
INSERT INTO `wp_icl_strings` VALUES('969', 'en', 'plugin jetpack', '9e883b8afe4513537fe25b278ad93097', 'Manage your Post By Email address from your <a href=\"%s\">profile settings</a>.', '1');
INSERT INTO `wp_icl_strings` VALUES('970', 'en', 'plugin jetpack', 'c9fa9c13aa7fa76b7a3a6052bba54493', 'When adding a gallery to your post, you now have the option to select a layout style for your images. We\'ve added support for Rectangular, Square, and Circular galleries. By default, galleries will continue to display using the standard thumbnail grid layout. To make the rectangular layout the default for all of your site\'s galleries, head over to <a href=\"%s\">Settings &rarr; Media</a> and check the box next to \"Display all your gallery pictures in a cool mosaic.\"', '1');
INSERT INTO `wp_icl_strings` VALUES('971', 'en', 'plugin jetpack', '3f65d6e17a11466983fd177702cf6a71', 'Contact Form', '1');
INSERT INTO `wp_icl_strings` VALUES('972', 'en', 'plugin jetpack', '177f0eb97c41c1d839bff85af7cb1120', 'Related Posts', '1');
INSERT INTO `wp_icl_strings` VALUES('973', 'en', 'plugin jetpack', 'dfec5697b46b5e258cbcba5939a82ee4', 'VaultPress dashboard', '1');
INSERT INTO `wp_icl_strings` VALUES('974', 'en', 'plugin jetpack', '175d5040b2f07a513372b344915a3586', 'Plans & Pricing', '1');
INSERT INTO `wp_icl_strings` VALUES('975', 'en', 'plugin jetpack', '19d32506eb12ea5655119eb8ae0870b8', 'Available shortcodes are: %l.', '1');
INSERT INTO `wp_icl_strings` VALUES('976', 'en', 'plugin jetpack', 'b929d1f21cd435d1e07781414940ef2b', '%s is a powerful markup language for writing complex mathematical equations, formulas, etc.', '1');
INSERT INTO `wp_icl_strings` VALUES('977', 'en', 'plugin jetpack', '309cefbdfb1afeb6ce0cf98ff22f2fd2', 'Jetpack combines the power of %s and the simplicity of WordPress to give you the ultimate in math blogging platforms.', '1');
INSERT INTO `wp_icl_strings` VALUES('978', 'en', 'plugin jetpack', '4d1caf47277861d9b410ea179bfca74d', '\"Related Posts\" shows additional relevant links from your site under your posts. If the feature is enabled, links appear underneath your Sharing Buttons and WordPress.com Likes (if you’ve turned these on).', '1');
INSERT INTO `wp_icl_strings` VALUES('979', 'en', 'plugin jetpack', '533486d1b7f661b6b1125cfaaaa90a9c', 'More information on using Related Posts.', '1');
INSERT INTO `wp_icl_strings` VALUES('980', 'en', 'plugin jetpack', 'a914ab08add8e279730b503816eed954', 'This feature uses the WordPress.com infrastructure and requires that your public content be mirrored there. If you see intermittent issues only effecting certain posts, request a reindex of your posts.', '1');
INSERT INTO `wp_icl_strings` VALUES('981', 'en', 'plugin jetpack', 'b0a28755640726936a20b8a315481b40', 'Developers can use WordPress.com\'s <a href=\'http://developer.wordpress.com/docs/oauth2/\'>OAuth2</a> authentication system and <a href=\'http://developer.wordpress.com/docs/api/\'>WordPress.com REST API</a> to manage and access your site\'s content.', '1');
INSERT INTO `wp_icl_strings` VALUES('982', 'en', 'plugin jetpack', '75d68bc0098f188427558f42918a2161', 'A contact form is a great way to offer your readers the ability to get in touch, without giving out your personal email address.', '1');
INSERT INTO `wp_icl_strings` VALUES('983', 'en', 'plugin jetpack', 'c1e369ff3757233ad3bea481aa86e570', 'Each contact form can easily be customized to fit your needs. When a user submits your contact form, the feedback will be filtered through <a href=\"http://akismet.com/\">Akismet</a> (if it is active on your site) to make sure it’s not spam. Any legitimate feedback will then be emailed to you, and added to your feedback management area.', '1');
INSERT INTO `wp_icl_strings` VALUES('984', 'en', 'plugin jetpack', '8b2183ff3201f82bd6b3e2cbb9f998c4', 'With the VideoPress module you can easily upload videos to your WordPress site and embed them in your posts and pages. This module requires a WordPress.com account with an active <a href=\"http://store.wordpress.com/premium-upgrades/videopress/\" target=\"_blank\">VideoPress subscription</a>.', '1');
INSERT INTO `wp_icl_strings` VALUES('985', 'en', 'plugin jetpack', 'aeb47878d4b04fce52921e0b1a21e407', 'VaultPress', '1');
