INSERT INTO `wp_icl_strings` VALUES('995', 'en', 'plugin jetpack', '480db5b5c8bed8c213a5c3872d8b5909', 'Subsriptions Screenshot', '1');
INSERT INTO `wp_icl_strings` VALUES('996', 'en', 'plugin jetpack', '16dd2723a4807d0a52f5ef97aa2fb37a', 'Jetpack Comments Screenshot', '1');
INSERT INTO `wp_icl_strings` VALUES('997', 'en', 'plugin jetpack', '3039caaf41751ca104176f52707859bf', 'Gallery Carousel Screenshot', '1');
INSERT INTO `wp_icl_strings` VALUES('998', 'en', 'plugin jetpack', '42e6feb7f76e910efcda54034ecc83ce', 'Custom CSS', '1');
INSERT INTO `wp_icl_strings` VALUES('999', 'en', 'plugin jetpack', 'd78fd18d6e1781e1dc52099527c4ef03', 'Mobile Theme', '1');
INSERT INTO `wp_icl_strings` VALUES('1000', 'en', 'plugin jetpack', '364b84d40ebc1f43c6a42fe1c0195093', 'Mobile Push Notifications', '1');
INSERT INTO `wp_icl_strings` VALUES('1001', 'en', 'plugin jetpack', 'fc4c4b90888a659b5a643c8e8ce88d2f', 'Post by Email', '1');
INSERT INTO `wp_icl_strings` VALUES('1002', 'en', 'plugin jetpack', '4a15cb86416a240328663848b985139d', 'Tiled Galleries', '1');
INSERT INTO `wp_icl_strings` VALUES('1003', 'en', 'plugin jetpack', 'ea69ec28bcb1952b096267cc88060102', 'Likes', '1');
INSERT INTO `wp_icl_strings` VALUES('1004', 'en', 'plugin jetpack', '7eefa9ca6d943870a9dc65a17439db3f', 'Google+ Profile', '1');
INSERT INTO `wp_icl_strings` VALUES('1005', 'en', 'plugin jetpack', '12cc1236593ec9c4b70766c3b06423e9', 'Your WordPress installation is currently being protected with the world&#8217;s best security, backup, and support.', '1');
INSERT INTO `wp_icl_strings` VALUES('1006', 'en', 'plugin jetpack', 'aa59173a13044772b5df3be4b3a4f718', 'With a monthly subscription, the VaultPress plugin will backup your site&#8217;s content, themes, and plugins in real-time, as well as perform regular security scans for common threats and attacks.', '1');
INSERT INTO `wp_icl_strings` VALUES('1007', 'en', 'plugin jetpack', 'cbb2797555553baaec10eccc1d2c7da8', 'Gravatar Hovercards', '1');
INSERT INTO `wp_icl_strings` VALUES('1008', 'en', 'plugin jetpack', '8a56ca238c6eb750600c2d59309d69a4', 'What&#8217;s a Hovercard?', '1');
INSERT INTO `wp_icl_strings` VALUES('1009', 'en', 'plugin jetpack', '2be29b64d5238831bee7ad1a6cb19bf7', 'Hovercards enhance plain Gravatar images with information about a person: name, bio, pictures, their contact info, and other services they use on the web like Twitter, Facebook, or LinkedIn.', '1');
INSERT INTO `wp_icl_strings` VALUES('1010', 'en', 'plugin jetpack', '8dc33946209b29b6d680b3b0ae1f6302', 'Hovercards offer a great way to show your internet presence and help people find your own blog.', '1');
INSERT INTO `wp_icl_strings` VALUES('1011', 'en', 'plugin jetpack', '15dfb3b01e372ba3c8a0a868c57a4dd4', 'Hovercards enhance plain Gravatar images with information about a person: name, bio, pictures, their contact info, and other services.', '1');
INSERT INTO `wp_icl_strings` VALUES('1012', 'en', 'plugin jetpack', '841da85fca676c76697b40c6bb9da26e', 'To see hovercards, look at any blog post on your blog that has comments. If the commenter has a hovercard associated with their gravatar, mouse over their image and the hovercard will appear. To turn hovercards off, click the Deactivate button above.', '1');
INSERT INTO `wp_icl_strings` VALUES('1013', 'en', 'plugin jetpack', '22c659297861d50d38f8a3b11af5e5f3', 'Shortcodes allow you to easily and safely embed media from other places in your site. With just one simple code, you can tell WordPress to embed YouTube, Flickr, and other media.', '1');
INSERT INTO `wp_icl_strings` VALUES('1014', 'en', 'plugin jetpack', '96385200dc325690861f39081b92c67c', 'Enter a shortcode directly into the Post/Page editor to embed media. For specific instructions follow the links below.', '1');
INSERT INTO `wp_icl_strings` VALUES('1015', 'en', 'plugin jetpack', '45ace477f0025b24655a1fb8dc334489', 'Instead of typing or copy-pasting long URLs, you can now get a short and simple link to your posts and pages. This uses the super compact wp.me domain name, and gives you a unique URL you can use that will be safe and reliable.', '1');
INSERT INTO `wp_icl_strings` VALUES('1016', 'en', 'plugin jetpack', '0a8694aef68284a7b903aa1827de5ab7', 'It&#8217;s perfect for use on Twitter, Facebook, and cell phone text messages where every character counts.', '1');
INSERT INTO `wp_icl_strings` VALUES('1017', 'en', 'plugin jetpack', '70f895a47fe8e31246a9f46221df6c1b', 'To use shortlinks, go to any already published post (or publish something new!). A &#8220;Get Shortlink&#8221; button will be visible under the Post title. When you click it, a dialog box will appear with the shortlink and you can copy and paste to Twitter, Facebook or wherever your heart desires.', '1');
INSERT INTO `wp_icl_strings` VALUES('1018', 'en', 'plugin jetpack', 'f15478b7b47b545f408e039646f4ade7', 'There are many plugins and services that provide statistics, but data can be overwhelming. WordPress.com Stats makes the most popular metrics easy to understand through a clear and attractive interface.', '1');
INSERT INTO `wp_icl_strings` VALUES('1019', 'en', 'plugin jetpack', 'fc28881047d939d33efee5d1e0a25a46', 'Publicize allows you to connect your blog to popular social networking sites and automatically share new posts with your friends.\\t You can make a connection for just yourself or for all users on your blog.', '0');
INSERT INTO `wp_icl_strings` VALUES('1020', 'en', 'plugin jetpack', '2374e8eb08860a7c3f1d5e6ec291b0e2', 'Publicize allows you to share your posts on Facebook, Twitter, Tumblr, Yahoo!, and Linkedin.', '1');
INSERT INTO `wp_icl_strings` VALUES('1021', 'en', 'plugin jetpack', 'f95bbd0e7d2b9b7f757b5f974df950fb', 'More information on using Publicize.', '1');
INSERT INTO `wp_icl_strings` VALUES('1022', 'en', 'plugin jetpack', 'df2e7307004e4b35136d96c732d3c5c1', 'Keep up with the latest happenings on all your WordPress sites and interact with other WordPress.com users.', '1');
INSERT INTO `wp_icl_strings` VALUES('1023', 'en', 'plugin jetpack', 'f9dde186e24573cff38774d361168031', 'Wow, that sounds nerdy.', '1');
INSERT INTO `wp_icl_strings` VALUES('1024', 'en', 'plugin jetpack', '598aeeb28da510e165f51338daf153a9', 'Share your posts with Twitter, Facebook, and a host of other services. You can configure services to appear as icons, text, or both. Some services have additional options to display smart buttons, such as Twitter, which will update the number of times the post has been shared.', '1');
INSERT INTO `wp_icl_strings` VALUES('1025', 'en', 'plugin jetpack', '168f894606fd9328aa23cad291c15cc2', 'The following services are included: Twitter, Facebook, Reddit, StumbleUpon, PressThis, Digg, LinkedIn, Google +1, Print, and Email.', '1');
INSERT INTO `wp_icl_strings` VALUES('1026', 'en', 'plugin jetpack', 'cf6c20f62ac444ae0b43bb917917bf2e', 'The following services are included: Twitter, Facebook, Reddit, StumbleUpon, Digg, LinkedIn, Google +1, Print, and Email.', '1');
INSERT INTO `wp_icl_strings` VALUES('1027', 'en', 'plugin jetpack', '7d750e88137564fc2d3bf2e09ec571e1', 'Additionally you can define your own custom services.', '1');
INSERT INTO `wp_icl_strings` VALUES('1028', 'en', 'plugin jetpack', '0c7d3d5c772e0b61353c21173c3d7882', 'Drag and drop sharing services into the enabled section to have them show up on your site, and drag them into the hidden section to have them hidden behind a button.', '1');
INSERT INTO `wp_icl_strings` VALUES('1029', 'en', 'plugin jetpack', '51275550370a4a097b697510cdfa4969', 'Extra Sidebar Widgets', '1');
INSERT INTO `wp_icl_strings` VALUES('1030', 'en', 'plugin jetpack', '6d8ed272ed7898ab7cf8a3d11b1d9605', 'The RSS Links Widget ', '0');
INSERT INTO `wp_icl_strings` VALUES('1031', 'en', 'plugin jetpack', '3994dd95652d64f8b77c1fe571d44019', 'allows you to add links to your blog&#8217;s post and comment RSS feeds in your sidebar. This makes it easy for your readers to stay updated when you post new content or receive new comments.', '1');
INSERT INTO `wp_icl_strings` VALUES('1032', 'en', 'plugin jetpack', 'da43d0915b6e1646b6497176f9ed4397', 'The Twitter Widget ', '1');
INSERT INTO `wp_icl_strings` VALUES('1033', 'en', 'plugin jetpack', '937ad8bbce37e07daea29476bc2b981c', 'shows your latest tweets within a sidebar on your theme. It&#8217;s an easy way to add more activity to your site. There are also a number of customization options.', '1');
INSERT INTO `wp_icl_strings` VALUES('1034', 'en', 'plugin jetpack', '5e46009ae41e7e829daf88e50cabc59e', 'The Facebook Like Box Widget ', '1');
INSERT INTO `wp_icl_strings` VALUES('1035', 'en', 'plugin jetpack', 'a4f524e7af96a9bfbc9aa513475937ba', 'shows your Facebook Like Box within a sidebar on your theme. It&#8217;s a great way to let your readers show their support.', '1');
INSERT INTO `wp_icl_strings` VALUES('1036', 'en', 'plugin jetpack', '73230aa0c1733ba689a64417e2119c0a', 'The Image Widget ', '1');
INSERT INTO `wp_icl_strings` VALUES('1037', 'en', 'plugin jetpack', 'd5deaaa4d2288bd98e455569250b0e73', 'allows you to easily add images to widget areas in your theme. It&#8217;s an easy way to add more visual interest to your site.', '1');
INSERT INTO `wp_icl_strings` VALUES('1038', 'en', 'plugin jetpack', '1af527487154f43f6d9170647a411e70', 'The RSS Links Widget', '1');
INSERT INTO `wp_icl_strings` VALUES('1039', 'en', 'plugin jetpack', '580a760cf62a228daee1ccbb3210e4cf', 'lets you easily add post and comment RSS feeds to a sidebar on your theme.', '1');
INSERT INTO `wp_icl_strings` VALUES('1040', 'en', 'plugin jetpack', 'f95fc49a7b27bcfb740b89201c7f34c1', 'The Twitter Widget', '0');
INSERT INTO `wp_icl_strings` VALUES('1041', 'en', 'plugin jetpack', '110067f62cebf6daa5678d6ac825f8db', 'shows your latest tweets within a sidebar on your theme.', '1');
INSERT INTO `wp_icl_strings` VALUES('1042', 'en', 'plugin jetpack', '86a1dad6fad9944f83028f9ff15c0989', 'The Facebook Like Box Widget', '0');
INSERT INTO `wp_icl_strings` VALUES('1043', 'en', 'plugin jetpack', '5766c10ff5a2209837d4a27d1309427e', 'shows your Facebook Like Box within a sidebar on your theme.', '1');
INSERT INTO `wp_icl_strings` VALUES('1044', 'en', 'plugin jetpack', '7b145a4630d34ecfc4c2da45f2fddb91', 'The Image Widget', '0');
INSERT INTO `wp_icl_strings` VALUES('1045', 'en', 'plugin jetpack', '0e8204a91d53eaf6d31e8d794fa289eb', 'lets you easily add images to a sidebar on your theme.', '1');
INSERT INTO `wp_icl_strings` VALUES('1046', 'en', 'plugin jetpack', 'd111abde663e1fd9595f7f9d2396710a', 'The Gravatar Widget', '0');
INSERT INTO `wp_icl_strings` VALUES('1047', 'en', 'plugin jetpack', '8e2c894eca3bff0fb7d514ef5990112e', 'allows you to pull in your Gravatar image along with some of your Gravatar profile data.', '0');
INSERT INTO `wp_icl_strings` VALUES('1048', 'en', 'plugin jetpack', 'c69cf83a5fd13d6638539a565f5e9623', 'The Gallery Widget', '0');
INSERT INTO `wp_icl_strings` VALUES('1049', 'en', 'plugin jetpack', 'cb9a76ebdbb890591a0f7b6bd936ba72', 'provides you with a simple way to display a photo gallery or slideshow in your blog’s sidebar.', '0');
INSERT INTO `wp_icl_strings` VALUES('1050', 'en', 'plugin jetpack', '6eaaba35683f2cdd01b80f56cb3c11b2', 'The Display WordPress Posts Widget', '0');
INSERT INTO `wp_icl_strings` VALUES('1051', 'en', 'plugin jetpack', 'fd5b403a318d3c87f8719432b49c3ea7', 'lets you display up to ten recent posts from another WordPress.com blog, or a self-hosted WordPress site with Jetpack enabled.', '0');
INSERT INTO `wp_icl_strings` VALUES('1052', 'en', 'plugin jetpack', 'debb13ba2bd1aa6402d20ab36abf0e38', 'The Readmill Widget', '0');
INSERT INTO `wp_icl_strings` VALUES('1053', 'en', 'plugin jetpack', '2058ba7e9dac2cb9191b89bdb023140c', 'allows your readers to send a book to their device with one click.', '0');
INSERT INTO `wp_icl_strings` VALUES('1054', 'en', 'plugin jetpack', 'a3bcb66b4d740c547a30ff6850b9dd34', 'The Upcoming Events Widget', '0');
INSERT INTO `wp_icl_strings` VALUES('1055', 'en', 'plugin jetpack', '46b0ecc235904c1f932eaaf463aaaa07', 'allows you to use an iCalendar link to display a list of events on your site.', '0');
INSERT INTO `wp_icl_strings` VALUES('1056', 'en', 'plugin jetpack', '71cbb6117b5a65f7b25f9574858234aa', 'Each of these widgets has a number of customization options.', '1');
INSERT INTO `wp_icl_strings` VALUES('1057', 'en', 'plugin jetpack', '4ca2c509994c2776d0880357b4e8e5be', 'Subscriptions', '1');
INSERT INTO `wp_icl_strings` VALUES('1058', 'en', 'plugin jetpack', '4ebb626587407fcb6a81340300be28e3', 'Easily allow any visitor to subscribe to all of your posts via email through a widget in your blog&#8217;s sidebar.  Every time you publish a post, WordPress.com will send a notification to all your subscribers.', '1');
INSERT INTO `wp_icl_strings` VALUES('1059', 'en', 'plugin jetpack', '11e84d7a89ad2155870efc9b8c708d38', 'When leaving comments, your visitors can also subscribe to a post&#8217;s comments to keep up with the conversation.', '1');
INSERT INTO `wp_icl_strings` VALUES('1060', 'en', 'plugin jetpack', '42526f1dcf754c71b6a09369bf6ae219', 'Enhanced Distribution', '1');
INSERT INTO `wp_icl_strings` VALUES('1061', 'en', 'plugin jetpack', 'a23edee89905f2b179e79f995d4ee9ec', 'Jetpack will automatically take the great published content from your blog or website and share it instantly with third party services like search engines, increasing your reach and traffic.', '1');
INSERT INTO `wp_icl_strings` VALUES('1062', 'en', 'plugin jetpack', '844d2bf902d0d3ac691f48320b6034b2', 'JSON API', '1');
INSERT INTO `wp_icl_strings` VALUES('1063', 'en', 'plugin jetpack', '6bbcf1e6ab1ea17eef1bc6ec79df2fdb', 'Jetpack will allow you to authorize applications and services to securely connect to your blog and allow them to use your content in new ways and offer you new functionality.', '1');
INSERT INTO `wp_icl_strings` VALUES('1064', 'en', 'plugin jetpack', 'fcccfa1c1ad5215031227c78c888f1cf', 'Jetpack Comments', '1');
INSERT INTO `wp_icl_strings` VALUES('1065', 'en', 'plugin jetpack', '8a483e10a25f395e70a4be4aee04b3d2', 'Jetpack Comments enables your visitors to use their WordPress.com, Twitter, or Facebook accounts when commenting on your site.', '1');
INSERT INTO `wp_icl_strings` VALUES('1066', 'en', 'plugin jetpack', '225bf3d9290b5f536b2e442259e78652', 'Carousel', '1');
INSERT INTO `wp_icl_strings` VALUES('1067', 'en', 'plugin jetpack', 'ec499fb2f4ccc0f4e1dfbe93d26f309f', 'With Carousel active, any standard WordPress galleries you have embedded in posts or pages will launch a gorgeous full-screen photo browsing experience with comments and EXIF metadata.', '1');
INSERT INTO `wp_icl_strings` VALUES('1068', 'en', 'plugin jetpack', '43f6161773a130e67f5e79528afa9457', 'The Custom CSS editor gives you the ability to add to or replace your theme\'s CSS, all while supplying syntax coloring, auto-indentation, and immediate feedback on the validity of the CSS you\'re writing.', '1');
INSERT INTO `wp_icl_strings` VALUES('1069', 'en', 'plugin jetpack', '5719d6698d4c4e9bd6387f4112e76100', 'There\'s a good chance that visitors to your site will be using a smartphone, and it\'s important to provide them with a great reading experience while on the small screen.', '1');
INSERT INTO `wp_icl_strings` VALUES('1070', 'en', 'plugin jetpack', '4024831595af08878a9c4c733af42410', 'Jetpack\'s mobile theme is optimized for small screens. It uses the header image, background, and widgets from your current theme for a great custom look. Post format support is included, so your photos and galleries will look fantastic on a smartphone.', '1');
INSERT INTO `wp_icl_strings` VALUES('1071', 'en', 'plugin jetpack', 'c33846191228bcaee84cec3f549e8eca', 'Visitors on iPhone, Android, Windows Phone, and other mobile devices will automatically see the mobile theme, with the option to view the full site. You can enable or disable the mobile theme by clicking the \"Activate\" or \"Deactive\" button above.', '1');
INSERT INTO `wp_icl_strings` VALUES('1072', 'en', 'plugin jetpack', '9d2861a099c1126bd0d865b1c95a5361', 'Infinite Scroll', '1');
INSERT INTO `wp_icl_strings` VALUES('1073', 'en', 'plugin jetpack', '95eb4c51cbbc7e37443da48a1d7f0f55', 'When you write great content, all you really want is people to find it, right?', '1');
INSERT INTO `wp_icl_strings` VALUES('1074', 'en', 'plugin jetpack', '1c92ef60f1632d515bd1f4587b55a93c', 'With the Infinite Scroll module and a supported theme, that\'s exactly what happens. Instead of the old way of navigating down a page by scrolling and then clicking a link to get to the next page, waiting for a page refresh&mdash;the document model of the web&mdash;infinite scrolling pulls the next set of posts automatically into view when the reader approaches the bottom of the page, more like an application.', '1');
INSERT INTO `wp_icl_strings` VALUES('1075', 'en', 'plugin jetpack', '7be312f382cc72151ca2a66c9da948c1', 'Until your theme supports Infinite Scroll, you won\'t be able to activate this module.', '1');
INSERT INTO `wp_icl_strings` VALUES('1076', 'en', 'plugin jetpack', '24d7f26d1472d261f35426c939589184', 'Post by Email is a way of publishing posts on your blog by email. Any email client can be used to send the email, allowing you to publish quickly and easily from devices such as cell phones.', '1');
INSERT INTO `wp_icl_strings` VALUES('1077', 'en', 'plugin jetpack', '1d0cc9dbe46116b1e276c950cc7c5125', 'More information on sending emails, attachments, and customizing your posts.', '1');
INSERT INTO `wp_icl_strings` VALUES('1078', 'en', 'plugin jetpack', 'fd22b656b23ca07a276181a4953ba2c4', 'Photon', '1');
INSERT INTO `wp_icl_strings` VALUES('1079', 'en', 'plugin jetpack', 'c0cd58d1579659b24cd6f7cf88243ab0', 'Give your site a boost by loading images in posts from the WordPress.com content delivery network. We cache your images and serve them from our super-fast network, reducing the burden on your Web host with the click of a button.', '1');
INSERT INTO `wp_icl_strings` VALUES('1080', 'en', 'plugin jetpack', '45c3af331e34a1b55da84c47a806ef06', 'Create elegant magazine-style mosaic layouts for your photos without having to use an external graphic editor.', '1');
INSERT INTO `wp_icl_strings` VALUES('1081', 'en', 'plugin jetpack', 'cd344aac2ff36af1ef4feff9d04b8f79', 'Note: Images in tiled galleries require extra-special processing, so they will be served from WordPress.com\'s CDN even if the Photon module is disabled.', '1');
INSERT INTO `wp_icl_strings` VALUES('1082', 'en', 'plugin jetpack', 'cc2463355114d8c45b729ae1b9b7feec', 'Likes allow your readers to show their appreciation for your posts and other published content using their WordPress.com accounts. Your readers will then be able to review their liked posts from WordPress.com.', '1');
INSERT INTO `wp_icl_strings` VALUES('1083', 'en', 'plugin jetpack', '667d2cd89592be6411ce0bd181c23b91', 'Displayed below your posts will be how many people have liked your posts and the Gravatars of those who have liked them.', '1');
INSERT INTO `wp_icl_strings` VALUES('1084', 'en', 'plugin jetpack', '13db41d4015ac549b50bca38d84f598d', 'More information on using Likes.', '1');
INSERT INTO `wp_icl_strings` VALUES('1085', 'en', 'plugin jetpack', '22086988a206c624d74514f38bd09ff4', 'The Google+ profile module allows you to connect your blog and Google+ accounts.', '1');
INSERT INTO `wp_icl_strings` VALUES('1086', 'en', 'plugin jetpack', '3fdafc814fbc291d36ab56d6ea3e65fe', 'Displayed below your posts will be a link back to your Google+ profile and a Google+ follow button. A link will also be added to your Google+ profile.', '1');
INSERT INTO `wp_icl_strings` VALUES('1087', 'en', 'plugin jetpack', 'b0051fc584de659c17020f9f8e6d9c3f', 'More information on using Google+ Profile.', '1');
INSERT INTO `wp_icl_strings` VALUES('1088', 'en', 'plugin jetpack', '6c937e77f5cc53b94927b1a302e90057', 'Omnisearch', '1');
INSERT INTO `wp_icl_strings` VALUES('1089', 'en', 'plugin jetpack', 'a08f7080702ff8f92a47e00152bdf517', 'Search once, get results from everything! Currently supports searching posts, pages, comments, media, and plugins.', '1');
INSERT INTO `wp_icl_strings` VALUES('1090', 'en', 'plugin jetpack', '62c0ab87adfdb72bba0127d79d3305a8', 'Omnisearch plays nice with other plugins by letting other providers offer results as well.', '1');
INSERT INTO `wp_icl_strings` VALUES('1091', 'en', 'plugin jetpack', '057535779712f2d3b7a1035b09d492ba', 'Widget Visibility', '1');
INSERT INTO `wp_icl_strings` VALUES('1092', 'en', 'plugin jetpack', '181deb36519f4664eaacc9eb7f0eb09e', 'Control which pages your widgets appear on with Widget Visibility.', '1');
INSERT INTO `wp_icl_strings` VALUES('1093', 'en', 'plugin jetpack', '30efc31c59b9740c6ebfcf9f17911a37', 'To control visibility, expand the widget and click the Visibility button next to the Save button, and then, choose a set of visibility options.', '1');
INSERT INTO `wp_icl_strings` VALUES('1094', 'en', 'plugin jetpack', '722e40a13a304f8f1e9a214544db1a28', 'For example, if you wanted the Archives widget to only appear on category archives and error pages, choose \"Show\" from the first dropdown and then add two rules: \"Page is 404 Error Page\" and \"Category is All Category Pages.\"', '1');
INSERT INTO `wp_icl_strings` VALUES('1095', 'en', 'plugin jetpack', 'a66ccb89b0ef1bc5e40ad458de62a1de', 'You can also hide widgets based on the current page. For example, if you don\'t want the Archives widget to appear on search results pages, choose \"Hide\" and \"Page is Search results.\"', '1');
INSERT INTO `wp_icl_strings` VALUES('1096', 'en', 'plugin jetpack', 'fb67a3ee0bf805dd7ed9318ae647db4d', 'VideoPress', '1');
INSERT INTO `wp_icl_strings` VALUES('1097', 'en', 'plugin jetpack', '4558726d8aec3bde52f8f6b59eb3a8c1', 'Single Sign On', '1');
INSERT INTO `wp_icl_strings` VALUES('1098', 'en', 'plugin jetpack', 'ec25867ffd5763ddb6fe89a47e0353ba', 'With WordPress.com Single Sign On, your users will be able to log in to or register for your WordPress site with the same credentials they use on WordPress.com.  It\'s safe and secure.', '1');
INSERT INTO `wp_icl_strings` VALUES('1099', 'en', 'plugin jetpack', '2f139ee6418fdc56e1cca55707d9efa3', 'Once enabled, a \"Log in with WordPress.com\" option will be added to your existing log in form.', '1');
INSERT INTO `wp_icl_strings` VALUES('1100', 'en', 'plugin jetpack', 'd2986ac8cb6bd55892099c1ffd6b1f6f', 'Monitor', '1');
INSERT INTO `wp_icl_strings` VALUES('1101', 'en', 'plugin jetpack', 'fc5b378b5d0d600214156a88bf780014', 'Nobody likes downtime, and that\'s why Jetpack Monitor is on the job, keeping tabs on your site. As soon as any downtime is detected, you will receive an email notification alerting you to the issue. That way you can act quickly, to get your site back online again!', '1');
INSERT INTO `wp_icl_strings` VALUES('1102', 'en', 'plugin jetpack', 'e4aff24acada41dcd8322c32bd24644b', 'We’ll also let you know as soon as your site is up and running, so you can keep an eye on total downtime.', '1');
INSERT INTO `wp_icl_strings` VALUES('1103', 'en', 'plugin jetpack', '2182a74bab7188d959e795d9301e87ff', 'Markdown', '1');
INSERT INTO `wp_icl_strings` VALUES('1104', 'en', 'plugin jetpack', 'fdfe32d03508b29c37ccfd847f82d7a0', 'Markdown lets you compose posts and comments with links, lists, and other styles using regular characters and punctuation marks. Markdown is used by writers and bloggers who want a quick and easy way to write rich text, without having to take their hands off the keyboard, and without learning a lot of complicated codes and shortcuts.', '1');
INSERT INTO `wp_icl_strings` VALUES('1105', 'en', 'plugin jetpack', 'Visit your _VaultPress_dashboard_.: To check your backups, see any security alerts, or check your VaultPress Vitality, visit your %s.', 'To check your backups, see any security alerts, or check your VaultPress Vitality, visit your %s.', '0');
INSERT INTO `wp_icl_strings` VALUES('1106', 'en', 'plugin jetpack', 'View _Plans_&_Pricing_. (VaultPress): View %s.', 'View %s.', '0');
INSERT INTO `wp_icl_strings` VALUES('1107', 'en', 'plugin jetpack', '9b3cdd57beeb99a80bc6fc101fe05771', 'Drag up or down\\nto re-arrange', '1');
INSERT INTO `wp_icl_strings` VALUES('1108', 'en', 'plugin jetpack', '118f77feff598376a776af9b8e738efc', 'Saved successfully', '1');
INSERT INTO `wp_icl_strings` VALUES('1109', 'en', 'plugin jetpack', '9628dfadd3f40ada3d266fa03d6ed67d', 'Are you sure you want to exit the form editor without saving?  Any changes you have made will be lost.', '1');
