INSERT INTO `wp_icl_strings` VALUES('1120', 'en', 'plugin jetpack', '3cf9064d67a8acc754449d33a3508603', 'How does this work?', '1');
INSERT INTO `wp_icl_strings` VALUES('1121', 'en', 'plugin jetpack', 'f2eb7569ad354671144724907bc9dbfb', 'By adding a contact form, your readers will be able to submit feedback to you. All feedback is automatically scanned for spam, and the legitimate feedback will be emailed to you.', '1');
INSERT INTO `wp_icl_strings` VALUES('1122', 'en', 'plugin jetpack', '8f2aa7ed7c70274d334da6b3a3a5fe7d', 'Can I add more fields?', '1');
INSERT INTO `wp_icl_strings` VALUES('1123', 'en', 'plugin jetpack', 'd91b770e0baee553beeeb4ff04c08441', 'Can I view my feedback within WordPress?', '1');
INSERT INTO `wp_icl_strings` VALUES('1124', 'en', 'plugin jetpack', '285738f2f8f5ead2670653196443a71b', 'Do I need to fill this out?', '1');
INSERT INTO `wp_icl_strings` VALUES('1125', 'en', 'plugin jetpack', '58805344a5c8deef2dc60c52a014f36e', 'Nope.  However, if you&#8217;d like to modify where your feedback is sent, or the subject line you can.  If you don&#8217;t make any changes here, feedback will be sent to the author of the page/post and the subject will be the name of this page/post.', '1');
INSERT INTO `wp_icl_strings` VALUES('1126', 'en', 'plugin jetpack', '913c861e3edf1642c0b766dfc28630ae', 'Edit this new field', '1');
