INSERT INTO `wp_icl_strings` VALUES('1147', 'en', 'plugin jetpack', 'error message in contact form builder: Oops, there was a problem generating your form.  You\'ll likely need to try again.', 'Oops, there was a problem generating your form.  You\'ll likely need to try again.', '0');
INSERT INTO `wp_icl_strings` VALUES('1148', 'en', 'plugin jetpack', 'Label to drag HTML form fields around to change their order in contact form builder: move', 'move', '0');
INSERT INTO `wp_icl_strings` VALUES('1149', 'en', 'plugin jetpack', 'Link to edit an HTML form field in contact form builder: edit', 'edit', '0');
