INSERT INTO `wp_icl_strings` VALUES('1152', 'en', 'plugin jetpack', '%1$s = \"Feedback\" in an HTML link: Yep, you can read your feedback at any time by clicking the \"%1$s\" link in the admin menu.', 'Yep, you can read your feedback at any time by clicking the \"%1$s\" link in the admin menu.', '0');
