INSERT INTO `wp_icl_strings` VALUES('2115', 'en', 'plugin LayerSlider', 'f30a5a0a150bc99b997ffb468904b06e', 'Pause slideshow', '0');
INSERT INTO `wp_icl_strings` VALUES('2116', 'en', 'plugin LayerSlider', 'f94ef77b4a2484acab460dc51c39eae5', 'The slideshow can temporally be paused while videos are playing. You can choose to permanently stop the pause until manual restarting.', '0');
INSERT INTO `wp_icl_strings` VALUES('2117', 'en', 'plugin LayerSlider', 'dacc03bb6106a6c64fc7594f444cb0cd', 'While playing', '0');
INSERT INTO `wp_icl_strings` VALUES('2118', 'en', 'plugin LayerSlider', 'd69deab82e6473366a7dcdffc6d50857', 'Permanently', '0');
INSERT INTO `wp_icl_strings` VALUES('2119', 'en', 'plugin LayerSlider', 'fa46ea6f6f6623fdd7039b5f1a8f3940', 'No action', '0');
INSERT INTO `wp_icl_strings` VALUES('2120', 'en', 'plugin LayerSlider', '4cae6acadf866d95afb764b4e6545be5', 'Youtube preview', '0');
INSERT INTO `wp_icl_strings` VALUES('2121', 'en', 'plugin LayerSlider', 'a82c7746076d8be03c68d5b651e0591e', 'The preview image quaility for YouTube videos. Please note, some videos do not have HD previews, and you may need to choose a lower quaility.', '0');
INSERT INTO `wp_icl_strings` VALUES('2122', 'en', 'plugin LayerSlider', '155a657eee2a2e2b07c3a47b93c478f6', 'Maximum quality', '0');
INSERT INTO `wp_icl_strings` VALUES('2123', 'en', 'plugin LayerSlider', 'b8924eb7fe4c3fb0219f7709d999acb6', 'High quality', '0');
INSERT INTO `wp_icl_strings` VALUES('2124', 'en', 'plugin LayerSlider', '31186f925fe95370a86649eb2b2e00c3', 'Medium quality', '0');
INSERT INTO `wp_icl_strings` VALUES('2125', 'en', 'plugin LayerSlider', '722597fc491a17f65a7b2c9db01ec6b1', 'Default quality', '1');
INSERT INTO `wp_icl_strings` VALUES('2126', 'en', 'plugin LayerSlider', 'd7e82ef6f0565a1d55f654cc5f6396aa', 'Image preload', '0');
INSERT INTO `wp_icl_strings` VALUES('2127', 'en', 'plugin LayerSlider', '780cc5bdd19d125d085cf687b74c161e', 'Preloads images used in the next slides for seamless animations.', '0');
INSERT INTO `wp_icl_strings` VALUES('2128', 'en', 'plugin LayerSlider', 'e7f33d85ee587f85c847c1c338a9f0d1', 'Lazy load images', '0');
INSERT INTO `wp_icl_strings` VALUES('2129', 'en', 'plugin LayerSlider', '8ba509465fbb9c9350c60ac21c2576f2', 'Loads images only when needed to save bandwidth and server resources. Relies on the preload feature.', '0');
INSERT INTO `wp_icl_strings` VALUES('2130', 'en', 'plugin LayerSlider', 'be0233bf54a7d9579cbf0356bce96b17', 'Use relative URLs', '0');
INSERT INTO `wp_icl_strings` VALUES('2131', 'en', 'plugin LayerSlider', '00cf981f6a6ebc3d812b2c9d49e71891', 'Use relative URLs for local images. This setting could be important when moving your WP installation.', '0');
INSERT INTO `wp_icl_strings` VALUES('2132', 'en', 'plugin LayerSlider', '5e1575919121f7253b56bb39b99e1042', 'YourLogo', '0');
INSERT INTO `wp_icl_strings` VALUES('2133', 'en', 'plugin LayerSlider', 'be622a5c9f59fa148c55c058ede850ed', 'A fixed image layer can be shown above the slider that remains still during slide progression. Can be used to display logos or watermarks.', '0');
INSERT INTO `wp_icl_strings` VALUES('2134', 'en', 'plugin LayerSlider', '77c34b7517dd216292658ee3b420dd1f', 'YourLogo style', '0');
INSERT INTO `wp_icl_strings` VALUES('2135', 'en', 'plugin LayerSlider', '355a12e47302b7e2627dc90d1c0e79c6', 'CSS properties to control the image placement and appearance.', '0');
INSERT INTO `wp_icl_strings` VALUES('2136', 'en', 'plugin LayerSlider', '1cfb56506d3621c27196a6aa02a23c39', 'YourLogo link', '0');
INSERT INTO `wp_icl_strings` VALUES('2137', 'en', 'plugin LayerSlider', 'd682c4c5de0f4983b6441d7dc1ddfe21', 'Enter an URL to link the YourLogo image.', '0');
INSERT INTO `wp_icl_strings` VALUES('2138', 'en', 'plugin LayerSlider', '5afb14c537c0ed4ed3805e8f9c12ae68', 'Link target', '0');
INSERT INTO `wp_icl_strings` VALUES('2139', 'en', 'plugin LayerSlider', '1a3cb622f5613168ed16ba4ffcfe49fe', 'Set a slide image', '0');
INSERT INTO `wp_icl_strings` VALUES('2140', 'en', 'plugin LayerSlider', '3f28b3c8785ecb212ad23bdbcc866659', 'The slide image/background. Click on the image to open the WordPress Media Library to choose or upload an image.', '0');
INSERT INTO `wp_icl_strings` VALUES('2141', 'en', 'plugin LayerSlider', '9d8cfafeba857023956c26437b6570fc', 'Set a slide thumbnail', '0');
INSERT INTO `wp_icl_strings` VALUES('2142', 'en', 'plugin LayerSlider', 'ee3a294033bb8e5d1a208d3abef859b3', 'The thumbnail image of this slide. Click on the image to open the WordPress Media Library to choose or upload an image. If you leave this field empty, the slide image will be used.', '0');
INSERT INTO `wp_icl_strings` VALUES('2143', 'en', 'plugin LayerSlider', '78c06e1390fd8f614f6bf259b4abf77a', 'Slide delay', '0');
INSERT INTO `wp_icl_strings` VALUES('2144', 'en', 'plugin LayerSlider', 'b0c71ca949422ff07096787e513bf3dc', 'Here you can set the time interval between slide changes, this slide will stay visible for the time specified here. This value is in millisecs, so the value 1000 means 1 second. Please don\'t use 0 or very low values.', '0');
INSERT INTO `wp_icl_strings` VALUES('2145', 'en', 'plugin LayerSlider', '1605a4f4a4e45503d3ac914de9fba80a', 'Time Shift', '0');
INSERT INTO `wp_icl_strings` VALUES('2146', 'en', 'plugin LayerSlider', 'e166744c44a3d596158ca121c78b7a47', 'You can control here the timing of the layer animations when the slider changes to this slide with a 3D/2D transition. Zero means that the layers of this slide will animate in when the slide transition ends. You can time-shift the starting time of the layer animations with positive or negative values.', '0');
INSERT INTO `wp_icl_strings` VALUES('2147', 'en', 'plugin LayerSlider', 'e1f70f4a4265cb51c1b219aa60eaa441', 'Enter URL', '0');
INSERT INTO `wp_icl_strings` VALUES('2148', 'en', 'plugin LayerSlider', 'b9bf71b88c58326f7bab0607f8fe73d0', 'If you want to link the whole slide, enter the URL of your link here.', '0');
INSERT INTO `wp_icl_strings` VALUES('2149', 'en', 'plugin LayerSlider', '1f7412ef1f7fdba3cc269af9a0b7a40c', 'Link Target', '0');
INSERT INTO `wp_icl_strings` VALUES('2150', 'en', 'plugin LayerSlider', '739cea2b85156183f917f2ccaa10a50c', '#ID', '0');
INSERT INTO `wp_icl_strings` VALUES('2151', 'en', 'plugin LayerSlider', '06f695600f91bfbd579d9d8f5a0147bd', 'You can apply an ID attribute on the HTML element of this slide to work with it in your custom CSS or Javascript code.', '0');
INSERT INTO `wp_icl_strings` VALUES('2152', 'en', 'plugin LayerSlider', '550dc007dba485adc22eddfe0af40a81', 'Deeplink', '0');
INSERT INTO `wp_icl_strings` VALUES('2153', 'en', 'plugin LayerSlider', '2370ab575d5bcb31286546ba6f3a84db', 'You can specify a slide alias name which you can use in your URLs with a hash mark, so LayerSlider will start with the correspondig slide.', '0');
INSERT INTO `wp_icl_strings` VALUES('2154', 'en', 'plugin LayerSlider', '7acdf85c69cc3c5305456a293524386e', 'Hidden', '0');
INSERT INTO `wp_icl_strings` VALUES('2155', 'en', 'plugin LayerSlider', 'a494a9272210a3aa3682f9fa8b6ad9fc', 'If you don\'t want to use this slide in your front-page, but you want to keep it, you can hide it with this switch.', '0');
INSERT INTO `wp_icl_strings` VALUES('2156', 'en', 'plugin LayerSlider', '1529fb44e04df26ff7666faa9f58c605', 'OffsetX', '0');
INSERT INTO `wp_icl_strings` VALUES('2157', 'en', 'plugin LayerSlider', '968efab4446c712ce7cedd4b1b1a611a', 'The horizontal offset to align the starting position of layers. Positive and negative numbers are allowed or enter left / right to position the layer out of the frame.', '0');
INSERT INTO `wp_icl_strings` VALUES('2158', 'en', 'plugin LayerSlider', '1508a7d829d65cf5e117fdc2aca0f155', 'OffsetY', '0');
INSERT INTO `wp_icl_strings` VALUES('2159', 'en', 'plugin LayerSlider', 'f640db70778e12f4916895fbd026a618', 'The vertical offset to align the starting position of layers. Positive and negative numbers are allowed or enter top / bottom to position the layer out of the frame.', '0');
INSERT INTO `wp_icl_strings` VALUES('2160', 'en', 'plugin LayerSlider', 'e02d2ae03de9d493df2b6b2d2813d302', 'Duration', '0');
INSERT INTO `wp_icl_strings` VALUES('2161', 'en', 'plugin LayerSlider', '1d3a7df7bbb3ea5ae4e03b43ff27faef', 'The transition duration in milliseconds when the layer enters into the slide. A second equals to 1000 milliseconds.', '0');
INSERT INTO `wp_icl_strings` VALUES('2162', 'en', 'plugin LayerSlider', '8f497c1a3d15af9e0c215019f26b887d', 'Delay', '0');
INSERT INTO `wp_icl_strings` VALUES('2163', 'en', 'plugin LayerSlider', '5426a600296a33dd42f6aeec0b8cee00', 'Delays the transition with the given amount of milliseconds before the layer enters into the slide. A second equals to 1000 milliseconds.', '0');
INSERT INTO `wp_icl_strings` VALUES('2164', 'en', 'plugin LayerSlider', '32485d52ad7aea25b3bc80d416e76a3b', 'Easing', '0');
INSERT INTO `wp_icl_strings` VALUES('2165', 'en', 'plugin LayerSlider', 'ca9a3cf0ea2e65cd611fe23633cd1186', 'The timing function of the animation. With this function you can manipulate the movement of the animated object. Please click on the link next to this select field to open easings.net for more information and real-time examples.', '0');
INSERT INTO `wp_icl_strings` VALUES('2166', 'en', 'plugin LayerSlider', '04e0385c10aefee8e4681617d2f3ef40', 'Fade', '0');
INSERT INTO `wp_icl_strings` VALUES('2167', 'en', 'plugin LayerSlider', 'ecdc93d174113fe69b7cbf2c42b5a1cb', 'Fade the layer during the transition.', '0');
INSERT INTO `wp_icl_strings` VALUES('2168', 'en', 'plugin LayerSlider', '8d2de5368588552fbae54044ac5c7b3d', 'Rotate', '0');
INSERT INTO `wp_icl_strings` VALUES('2169', 'en', 'plugin LayerSlider', 'cd12c7e0788a518d3006f63528b2a8ac', 'Rotates the layer clockwise from the given angle to zero degree. Negative values are allowed for counterclockwise rotation.', '0');
INSERT INTO `wp_icl_strings` VALUES('2170', 'en', 'plugin LayerSlider', '801e0dd823542f625e0f2ee135efb62d', 'RotateX', '0');
INSERT INTO `wp_icl_strings` VALUES('2171', 'en', 'plugin LayerSlider', 'cff7d84fa1adfc0d322a96d83263d34f', 'Rotates the layer along the X (horizontal) axis from the given angle to zero degree. Negative values are allowed for reverse direction.', '0');
INSERT INTO `wp_icl_strings` VALUES('2172', 'en', 'plugin LayerSlider', 'ea0928ab345567847020e1544892fba0', 'RotateY', '0');
INSERT INTO `wp_icl_strings` VALUES('2173', 'en', 'plugin LayerSlider', '90cf2e0811b572efc9bacedd96c1874f', 'Rotates the layer along the Y (vertical) axis from the given angle to zero degree. Negative values are allowed for reverse direction.', '0');
INSERT INTO `wp_icl_strings` VALUES('2174', 'en', 'plugin LayerSlider', '5a013b463ee01be2924568775fdddfb1', 'SkewX', '0');
INSERT INTO `wp_icl_strings` VALUES('2175', 'en', 'plugin LayerSlider', 'cf97c4dfc2420380f05e616054ddf552', 'Skews the layer along the X (horizontal) axis from the given angle to 0 degree. Negative values are allowed for reverse direction.', '0');
INSERT INTO `wp_icl_strings` VALUES('2176', 'en', 'plugin LayerSlider', 'eeb66258f8bf4bb3c0763461b5c1797d', 'SkewY', '0');
INSERT INTO `wp_icl_strings` VALUES('2177', 'en', 'plugin LayerSlider', '43fe670cce22c21b1ef30ba69504419e', 'Skews the layer along the Y (vertical) axis from the given angle to 0 degree. Negative values are allowed for reverse direction.', '0');
INSERT INTO `wp_icl_strings` VALUES('2178', 'en', 'plugin LayerSlider', 'b5e0c179725e7f282ffb8e6a96797b49', 'ScaleX', '0');
INSERT INTO `wp_icl_strings` VALUES('2179', 'en', 'plugin LayerSlider', 'df75036010b51c538ccb3bd5c83ba2c6', 'Scales the layer\'s width from the given value to its original size.', '0');
INSERT INTO `wp_icl_strings` VALUES('2180', 'en', 'plugin LayerSlider', '3475b72c6483a5c871d245e2567c96c7', 'ScaleY', '0');
INSERT INTO `wp_icl_strings` VALUES('2181', 'en', 'plugin LayerSlider', '4a446f39bb809bfa606fada4eeb151a8', 'Scales the layer\'s height from the given value to its original size.', '0');
INSERT INTO `wp_icl_strings` VALUES('2182', 'en', 'plugin LayerSlider', 'a98b8b98dda22cc1a336c4f7152e4d79', 'TransformOrigin', '0');
INSERT INTO `wp_icl_strings` VALUES('2183', 'en', 'plugin LayerSlider', 'c233c0409139afbf12d99249676da9bb', 'This option allows you to modify the origin for transformations of the layer according to its position. The three values represent the X, Y and Z axis in 3D space. OriginX can be left, center, right, a number or a percentage value. OriginY can be top, center, bottom, a number or a percentage value. OriginZ can be a number and corresponds the depth in 3D space.', '0');
INSERT INTO `wp_icl_strings` VALUES('2184', 'en', 'plugin LayerSlider', '3326c43fa7fb524ec75cb0cfa0c38196', 'The horizontal offset to align the ending position of layers. Positive and negative numbers are allowed or write left / right to position the layer out of the frame.', '0');
INSERT INTO `wp_icl_strings` VALUES('2185', 'en', 'plugin LayerSlider', 'ccafb39813a16b76193f870c5f355c01', 'The vertical offset to align the starting position of layers. Positive and negative numbers are allowed or write top / bottom to position the layer out of the frame.', '0');
INSERT INTO `wp_icl_strings` VALUES('2186', 'en', 'plugin LayerSlider', '5cb4d7a61233e6cb7504d7567f0546ff', 'The transition duration in milliseconds when the layer leaves the slide. A second equals to 1000 milliseconds.', '0');
INSERT INTO `wp_icl_strings` VALUES('2187', 'en', 'plugin LayerSlider', 'c70201e2f6db78f07f049b65937d43a1', 'Show until', '0');
INSERT INTO `wp_icl_strings` VALUES('2188', 'en', 'plugin LayerSlider', 'f784da2712b23e04cb52873a6e88a547', 'The layer will be visible for the time you specify here, then it will slide out. You can use this setting for layers to leave the slide before the slide itself animates out, or for example before other layers will slide in. This value in millisecs, so the value 1000 means 1 second.', '0');
INSERT INTO `wp_icl_strings` VALUES('2189', 'en', 'plugin LayerSlider', 'c9e306fecaa96c35349c40a1b385df30', 'Rotates the layer clockwise by the given angle from its original position. Negative values are allowed for counterclockwise rotation.', '0');
INSERT INTO `wp_icl_strings` VALUES('2190', 'en', 'plugin LayerSlider', '42b1620bed4f34f9454074600621ccc4', 'Rotates the layer along the X (horizontal) axis by the given angle from its original state. Negative values are allowed for reverse direction.', '0');
INSERT INTO `wp_icl_strings` VALUES('2191', 'en', 'plugin LayerSlider', '5acb79cbab92d9a9cca70975955d95d3', 'Rotates the layer along the Y (vertical) axis by the given angle from its orignal state. Negative values are allowed for reverse direction.', '0');
INSERT INTO `wp_icl_strings` VALUES('2192', 'en', 'plugin LayerSlider', '5e90e0966f87e08fa8d1d4a5b9529973', 'Skews the layer along the X (horizontal) axis by the given angle from its orignal state. Negative values are allowed for reverse direction.', '0');
INSERT INTO `wp_icl_strings` VALUES('2193', 'en', 'plugin LayerSlider', '327dd6f928181dee8780f307d309f26c', 'Skews the layer along the Y (vertical) axis by the given angle from its original state. Negative values are allowed for reverse direction.', '0');
INSERT INTO `wp_icl_strings` VALUES('2194', 'en', 'plugin LayerSlider', 'f741fe74d4a02f918397a3eb85a5f82a', 'Scales the layer\'s width by the given value from its original size.', '0');
INSERT INTO `wp_icl_strings` VALUES('2195', 'en', 'plugin LayerSlider', '0d668aae291288a33412872293cf48e1', 'Scales the layer\'s height by the given value from its original size.', '0');
INSERT INTO `wp_icl_strings` VALUES('2196', 'en', 'plugin LayerSlider', 'b437c451aa3282f75304078beaccd7f2', 'Parallax Level', '0');
INSERT INTO `wp_icl_strings` VALUES('2197', 'en', 'plugin LayerSlider', '5400cb39abde575471e0644bc599e1bb', 'Applies a parallax effect on layers when you move your mouse over the slider. Higher values make the layer more sensitive to mouse move. Negative values are allowed.', '0');
INSERT INTO `wp_icl_strings` VALUES('2198', 'en', 'plugin LayerSlider', 'a1fa27779242b4902f7ae3bdd5c6d508', 'Type', '1');
INSERT INTO `wp_icl_strings` VALUES('2199', 'en', 'plugin LayerSlider', '274afb0a973300653f19b31664339aa2', 'Delay before the animation start when the layer slides out. This value is in millisecs, so the value 1000 means 1 second.', '0');
INSERT INTO `wp_icl_strings` VALUES('2200', 'en', 'plugin LayerSlider', '85a7cd587d6142dbfc1a4de05af7b75d', 'Scale', '0');
INSERT INTO `wp_icl_strings` VALUES('2201', 'en', 'plugin LayerSlider', '334eece3fce626ad5f328441d820586e', 'You can set the initial scale of this layer here which will be animated to the default (1.0) value.', '0');
INSERT INTO `wp_icl_strings` VALUES('2202', 'en', 'plugin LayerSlider', '1fbbfeb55b30193a6ab42063411d0c87', 'You can set the ending scale value here, this sublayer will be animated from the default (1.0) value to yours.', '0');
INSERT INTO `wp_icl_strings` VALUES('2203', 'en', 'plugin LayerSlider', 'e9e245065a77b7927aaccb2cf9d2ffcd', 'If you don\'t want to use this layer, but you want to keep it, you can hide it with this switch.', '0');
INSERT INTO `wp_icl_strings` VALUES('2204', 'en', 'plugin LayerSlider', '0aa6f4210bf373c95eda00232e93cd98', 'Distance', '0');
INSERT INTO `wp_icl_strings` VALUES('2205', 'en', 'plugin LayerSlider', '2408db8dd5acd58e5a2cf334c1bd5a1d', 'The default value is -1 which means that the layer will be positioned exactly outside of the slide container. You can use the default setting in most of the cases. If you need to set the start or end position of the layer from further of the edges of the slide container, you can use 2, 3 or higher values.', '0');
INSERT INTO `wp_icl_strings` VALUES('2206', 'en', 'plugin LayerSlider', '627b4c0e8a9b46747497d4bae491a6c2', 'If you want to link your layer, type here the URL. You can use a hash mark followed by a number to link this layer to another slide. Example: #3 - this will switch to the third slide.', '0');
INSERT INTO `wp_icl_strings` VALUES('2207', 'en', 'plugin LayerSlider', 'a33a3e8542755c06996a81a78878b66b', 'URL target', '0');
INSERT INTO `wp_icl_strings` VALUES('2208', 'en', 'plugin LayerSlider', '32954654ac8fe66a1d09be19001de2d4', 'Width', '1');
INSERT INTO `wp_icl_strings` VALUES('2209', 'en', 'plugin LayerSlider', 'edac8da7d60b7624d4b131bc47a5eb3b', 'You can set the width of your layer. You can use pixels, percentage, or the default value \'auto\'. Examples: 100px, 50% or auto.', '0');
INSERT INTO `wp_icl_strings` VALUES('2210', 'en', 'plugin LayerSlider', 'eec6c4bdbd339edf8cbea68becb85244', 'Height', '1');
INSERT INTO `wp_icl_strings` VALUES('2211', 'en', 'plugin LayerSlider', 'c6272de402f4e075758f7d27f108d6c1', 'You can set the height of your layer. You can use pixels, percentage, or the default value \'auto\'. Examples: 100px, 50% or auto', '0');
INSERT INTO `wp_icl_strings` VALUES('2212', 'en', 'plugin LayerSlider', 'a4ffdcf0dc1f31b9acaf295d75b51d00', 'Top', '0');
INSERT INTO `wp_icl_strings` VALUES('2213', 'en', 'plugin LayerSlider', '4ce53ede45d38aa6228b7a2e4a9a2d6f', 'The layer position from the top of the slide. You can use pixels and percentage. Examples: 100px or 50%. You can move your layers in the preview above with a drag n\' drop, or set the exact values here.', '0');
INSERT INTO `wp_icl_strings` VALUES('2214', 'en', 'plugin LayerSlider', '945d5e233cf7d6240f6b783b36a374ff', 'Left', '1');
INSERT INTO `wp_icl_strings` VALUES('2215', 'en', 'plugin LayerSlider', '38ab4523d162374efdee06dcaa89d7dd', 'The layer position from the left side of the slide. You can use pixels and percentage. Examples: 100px or 50%. You can move your layers in the preview above with a drag n\' drop, or set the exact values here.', '0');
INSERT INTO `wp_icl_strings` VALUES('2216', 'en', 'plugin LayerSlider', '9bef4210a675b3352481eaba774135e2', 'Padding on the top of the layer. Example: 10px', '0');
INSERT INTO `wp_icl_strings` VALUES('2217', 'en', 'plugin LayerSlider', '92b09c7c48c520c3c55e497875da437c', 'Right', '1');
INSERT INTO `wp_icl_strings` VALUES('2218', 'en', 'plugin LayerSlider', 'ee9c7d68f4827e199b21138aff29ce0a', 'Padding on the right side of the layer. Example: 10px', '0');
INSERT INTO `wp_icl_strings` VALUES('2219', 'en', 'plugin LayerSlider', '2ad9d63b69c4a10a5cc9cad923133bc4', 'Bottom', '0');
INSERT INTO `wp_icl_strings` VALUES('2220', 'en', 'plugin LayerSlider', '6b70b97995dce26c04f5b5daea657e4d', 'Padding on the bottom of the layer. Example: 10px', '0');
INSERT INTO `wp_icl_strings` VALUES('2221', 'en', 'plugin LayerSlider', '28a65f6de7eebf8d4c376a2abe749bd2', 'Padding on the left side of the layer. Example: 10px', '0');
INSERT INTO `wp_icl_strings` VALUES('2222', 'en', 'plugin LayerSlider', '510f6afc8355884a0102b52329b5aec7', 'Border on the top of the layer. Example: 5px solid #000', '0');
INSERT INTO `wp_icl_strings` VALUES('2223', 'en', 'plugin LayerSlider', '6c8f384c72285ae0d6f94c14a5fa37e9', 'Border on the right side of the layer. Example: 5px solid #000', '0');
INSERT INTO `wp_icl_strings` VALUES('2224', 'en', 'plugin LayerSlider', 'b850529030bbb5c69a604c5dc8764e84', 'Border on the bottom of the layer. Example: 5px solid #000', '0');
INSERT INTO `wp_icl_strings` VALUES('2225', 'en', 'plugin LayerSlider', '5d21c59909857b765d5d33b1fc13ba82', 'Border on the left side of the layer. Example: 5px solid #000', '0');
INSERT INTO `wp_icl_strings` VALUES('2226', 'en', 'plugin LayerSlider', 'cefc4f7cbc8c34762e0f76703e7e174e', 'Family', '0');
INSERT INTO `wp_icl_strings` VALUES('2227', 'en', 'plugin LayerSlider', '909bbc55b3fe644f3f7902be12c0edf8', 'List of your chosen fonts separated with a comma. Please use apostrophes if your font names contains white spaces. Example: Helvetica, Arial, sans-serif', '0');
INSERT INTO `wp_icl_strings` VALUES('2228', 'en', 'plugin LayerSlider', '6f6cb72d544962fa333e2e34ce64f719', 'Size', '0');
INSERT INTO `wp_icl_strings` VALUES('2229', 'en', 'plugin LayerSlider', 'f7c6e3ec6e0a88ce6b2b2359233290ee', 'The font size in pixels. Example: 16px.', '0');
INSERT INTO `wp_icl_strings` VALUES('2230', 'en', 'plugin LayerSlider', '422e94aac2576bd9aa794e942a115764', 'Line-height', '0');
INSERT INTO `wp_icl_strings` VALUES('2231', 'en', 'plugin LayerSlider', 'e23516d21150cac0bb665a06983f9c27', 'The line height of your text. The default setting is \'normal\'. Example: 22px', '0');
