INSERT INTO `wp_icl_strings` VALUES('4584', 'en', 'plugin woocommerce', 'ec243ccd87f0e413865128410a380225', '%s WooCommerce %s is more powerful, stable and secure than ever before. We hope you enjoy using it.', '0');
INSERT INTO `wp_icl_strings` VALUES('4585', 'en', 'plugin woocommerce', '3c9725047280b9e633385a026099deae', 'Version %s', '0');
INSERT INTO `wp_icl_strings` VALUES('4586', 'en', 'plugin woocommerce', '19a07632e939c9e1f35debb3ff712c97', 'As part of the API, we\'ve introduced a UI for the Webhook system in WooCommerce 2.3. This makes it easier for 3rd party apps to integrate with WooCommerce. Read more in our %sdocs%s.', '0');
INSERT INTO `wp_icl_strings` VALUES('4587', 'en', 'plugin woocommerce', 'ec8dc2e5b52b0062767a7d51f66f21b7', 'We have added a new option to geolocate the \"Default Customer Location\". Coupled with ability to show taxes in your store based on this location, you can show relevant prices store-wide. Enable this in the %ssettings%s.', '0');
INSERT INTO `wp_icl_strings` VALUES('4588', 'en', 'plugin woocommerce', 'e464a04de66b0b2ca2a9579e4f53e8e3', 'If you\'re looking to customise the look and feel of the frontend in 2.3, take a look at the free %sWooCommerce Colors plugin%s. This lets you change the colors with a live preview.', '0');
INSERT INTO `wp_icl_strings` VALUES('4589', 'en', 'plugin woocommerce', 'dff24f090cd66c74e895571661c3626f', 'The built in Simplify Commerce Gateway (available in the US) now supports %sHosted Payments%s - a PCI Compliant hosted payment platform.', '0');
INSERT INTO `wp_icl_strings` VALUES('4590', 'en', 'plugin woocommerce', '428f4e42083c902d8b068afe0227aa06', 'To make email customization simpler, we\'ve included a CSS Inliner in this release, some new template files for styling emails, and some additional hooks for developers. Read more on our %sdeveloper blog%s.', '0');
INSERT INTO `wp_icl_strings` VALUES('4591', 'en', 'plugin woocommerce', '83907fc3408993b70e76bed83e856727', 'We have simplified the coupon system to ensure discounts are never applied to taxes, and we\'ve improved support for discounting products inclusive of tax. Read more on our %sdevelop blog%s.', '0');
INSERT INTO `wp_icl_strings` VALUES('4592', 'en', 'plugin woocommerce', 'ad99b1465543ab25fe197bf15b544efc', 'WooCommerce is developed and maintained by a worldwide team of passionate individuals and backed by an awesome developer community. Want to see your name? <a href=\"%s\">Contribute to WooCommerce</a>.', '0');
INSERT INTO `wp_icl_strings` VALUES('4593', 'en', 'plugin woocommerce', '4a43f78edb9f1dd9cdc9810e47474a00', 'WooCommerce has been kindly translated into several other languages thanks to our translation team. Want to see your name? <a href=\"%s\">Translate WooCommerce</a>.', '0');
INSERT INTO `wp_icl_strings` VALUES('4594', 'en', 'plugin woocommerce', '4070217917db2a77aa6643b2ce47ceed', 'View %s', '0');
