INSERT INTO `wp_icl_strings` VALUES('4598', 'en', 'plugin woocommerce', '9eba58f575eec7b014b6e33eb1c4943f', 'UI Overhaul', '0');
INSERT INTO `wp_icl_strings` VALUES('4599', 'en', 'plugin woocommerce', 'dda195c494eb40732e0e35c8490cdf0a', 'We\'ve updated the user interface on both the front and backend of WooCommerce 2.3 \"Handsome Hippo\".', '0');
INSERT INTO `wp_icl_strings` VALUES('4600', 'en', 'plugin woocommerce', '6b6991280964f7903ac79605e362c00e', 'Frontend UI Improvements', '0');
INSERT INTO `wp_icl_strings` VALUES('4601', 'en', 'plugin woocommerce', '9d487707338391a5e3f813586861871d', 'On the frontend there are several UX enhancements such as the undo-remove-from cart link and responsive table design as well as a fresh, modern look which meshes more fluidly with the current design trends of default WordPress themes.', '0');
INSERT INTO `wp_icl_strings` VALUES('4602', 'en', 'plugin woocommerce', '6907f6dc166b4afdb7c3ea0109815bfe', 'Backend UI Improvements', '0');
INSERT INTO `wp_icl_strings` VALUES('4603', 'en', 'plugin woocommerce', 'a5d1733d3926947647a75edd39702b7e', 'On the backend, settings have been re-organised and perform better on hand-held devices for an all round improved user experience. ', '0');
INSERT INTO `wp_icl_strings` VALUES('4604', 'en', 'plugin woocommerce', '1f3d2040fefbb969b5ae3b06a857334a', 'Webhooks UI', '0');
