INSERT INTO `wp_icl_strings` VALUES('4608', 'en', 'plugin woocommerce', '368e9553b6907f4f1754c3832160759e', 'Sales reports can now show net and gross amounts, we\'ve added a print stylesheet, and added extra data on refunds to reports.', '0');
